The Football League Show 24.08.2013 

Duration: 1 hour, 15 min

Manish Bhasin presents the best of the action from all three divisions of the Football League.

After enjoying a bright start to the new season under manager Brian McDermott, Leeds head to Ipswich, who are also showing signs of improvement under manager Mick McCarthy. Meanwhile, two of the pre-season favourites for promotion, Bolton Wanderers and Queens Park Rangers, go head to head.
